"use strict";

const URL = require("../config/urls");
class IotCameraAnalytics {
    // POST /api/v1/iotAnalytics/iot-locations
    postIotLocations(options, callback) {
      return this.apiClient._postRequest(URL.IOT_CAMERA_ANALYTICS.IOT_LOCATIONS, options, callback);
    }
  
    // POST /api/v1/iotAnalytics/iot-locations/grids
    postIotLocationsGrids(options, callback) {
      return this.apiClient._postRequest(URL.IOT_CAMERA_ANALYTICS.IOT_LOCATIONS_GRIDS, options, callback);
    }
  }
  

  module.exports = IotCameraAnalytics;
  